# 25821 Palindromic Primes

L, H = map(int, input().split())
result = ''
b64 = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/"
b64_to_ascii = {v: i for i, v in enumerate(b64)}
precalculation = [0 for _ in range(1000001 * 2 + 6)]
for i, v in enumerate(result):
    for j in range(6):
        precalculation[i * 6 + j] = (b64_to_ascii[v] >> j) & 1
answer = 0
for i in range(1, 1000001):
    odd_palindrome = int(str(i)[:-1] + str(i)[::-1])
    even_palindrome = int(str(i)[:] + str(i)[::-1])
    if L <= odd_palindrome <= H and precalculation[i * 2]:
        answer += 1
    if L <= even_palindrome <= H and precalculation[i * 2 + 1]:
        answer += 1
print(answer)